  return (
    <>
    <Center>
      <Box borderRadius='md'
      w="375px"
      h="667px"
      marginTop="40px"
      overflow="scroll"
      letterSpacing='wide'
      bg="gray.200"
      boxShadow="base">
        <OpenCartProvider>
        <FoodsListBox />
        {/* <CartPageBox /> */}
